import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import styles from './pages.css';

class Home extends Component {
  render() {
    return (
    <div className="App">
      <h1 className={styles.headerStyle} >Wearing Health</h1>
      {/* Link to User.js */}
      <Link to={'./UserAdd'}>
        <button variant="raised">
            Registrar usuari
        </button>
      </Link>

      {/* Link to Data.js */}
      <Link to={'./DeviceAdd'}>
          <button variant="raised">
            Afegir Wearable
          </button>
      </Link>

      {/* Link to Data.js */}
      <Link to={'./Data'}>
          <button variant="raised">
            Visualitzar Dades
          </button>
      </Link>

        {/* Link to Data.js */}
      <Link to={'./Data'}>
          <button variant="raised">
            Visualitzar Dades
          </button>
      </Link>
      </div>
    );
  }
}
export default Home;
